function global:Get-NetSessionEnum {
<#
.SYNOPSIS
This script automates the enumeration of NetSessionEnum (network sessions of connected users in the domain), providing an easy and object-based output to facilitate AD Reconnaissance for Adversary simulation & Red Teams.

.DESCRIPTION
This script will enumerate net connections to specific computers and users, or by default, to all domain controllers by all domain users, and output the username, the IP he's logged on from, the hostname he's logged on from, to which computer/Domain Controller he's connected to, how long he's connected to this computer, and how long has he been idle (or, effectively, when he was last active on that connection).
It uses the NetSess tool by Joe Richards, yet only as Bytes, so effectively, all you need is this script with no other dependencies. It can output the reconnaissance data to the screen, as an unfiltered object (that you can query and filter as Cached Results for fast performance), or to a GUI (using PowerShell ISE).

.PARAMETER UserName
The UserName to filter the results by. Default is all Domain users.

.PARAMETER ComputerName
The ConnectedTo computer name, to filter the results by. Default is all Domain Controllers.

.PARAMETER UseCachedResults
Makes subsequent runs of the script perform much faster, using Cached results from previous run.
Highly useful when you want to query other users or open as gui *after* the initial run.

.PARAMETER AllDomainComputers
Checks for connected users on all computer account in the domain. Cannot be used together with -ComputerName (will override -ComputerName when used at the same run).

.PARAMETER OpenAsGUI
Opens the results in a GUI form. Requires PowerShell ISE to be installed on this machine.

.EXAMPLE
Get-NetSessionEnum
Runs the initial & full scan with default choices - all users on all domain cotrollers. Recommended if you need a full scan, or if want to run the script again with other/more parameters and filters later.

.EXAMPLE
Get-NetSessionEnum -UserName administrator
Brings all the network connections made by the user with SamAccountName administrator. Invokes a full (fresh) scan on all domain computers.

.EXAMPLE
Get-NetSessionEnum -AllDomainComputers
Invokes a full scan for all connected users on all domain computers. Note that this takes longer to complete, yet useful if you want query for user connections across all domain clients.

.EXAMPLE
Get-NetSessionEnum -UserName administrator -ComputerName WIN7-PC, WIN10-PC, DC2
Brings all the network connections made by the user with SamAccountName administrator to those 3 specified computers.

.EXAMPLE
Get-NetSessionEnum -UseCachedResults -UserName administrator
Brings all the network connections made by the user with SamAccountName administrator from previously cached results (meaning, the script must have ran at least once before). Gives MUCH faster performance, as the previous scan results are already in memory and just filtered but username.

.EXAMPLE
Get-NetSessionEnum -OpenAsGUI
Runs a full 'fresh' scan with default choices (all users on all domain controllers) and outputs the results into an adhoc GUI (form), that you can easily filter by typing in your keywords (username, computer..) or using specific criterias, directly on the form.

.NOTES
v1.0 by Y1nTh35h3ll. Comments welcome to yossis@protonmail.com. Special Thanks to Joe Richards (joe@joeware.net) for creating his NetSess tool, used by this script.

.LINK
https://www.10root.com
#>
[cmdletbinding()]
param (
    [string]$UserName = $null,
    [string[]]$ComputerName = $null,
    [switch]$UseCachedResults,
    [switch]$AllDomainComputers,
    [switch]$OpenAsGUI
)
# If chosen to use Cached results, yet there are no cached results in memory, break and ask to run again
if ($UseCachedResults -and ($Global:Results -eq $null)) {Write-Warning "No Cached Results found from previous run. Please run again without the -UserCachedResults switch."; break}
# Main Script Begin
if (!($UseCachedResults)) {
# Build the tool into a temp dir
write-host "Initiating..." -ForegroundColor cyan
$EXEStr=''
[System.Convert]::FromBase64String($EXEStr) | Set-Content -Path $env:TEMP\ns.exe -Encoding Byte
# Set Error Action Preference to silently continue, to discard harmless 'red messages' while running the EXE tool
$CurrentEAP = $ErrorActionPreference; $ErrorActionPreference = "SilentlyContinue";
# If no ComputerName(s) where specified, get all Domain Controllers in the domain
if (($ComputerName -eq $null) -or $AllDomainComputers) {
    write-host "Getting domain computer names..." -ForegroundColor cyan
    if ($ComputerName -ne $null) {write-host "-AllDomainComputers was specified with -Computername. If you want to abort and re-specify, press CTRL+C, or wait while we get all domain computers." -ForegroundColor cyan}
    $s = New-Object System.DirectoryServices.DirectorySearcher
    if ($AllDomainComputers) {$s.Filter = '(objectCategory=computer)'}
        else { # Query all the DCs (Default)
        $s.Filter = '(&(objectCategory=computer)(userAccountControl:1.2.840.113556.1.4.803:=8192))'
        }
    [System.Collections.ArrayList]$ComputerName = ($s.FindAll().GetDirectoryEntry().name)
    if ($AllDomainComputers) {$ComputerName.Remove($env:COMPUTERNAME); $ComputerName.Add('LOCALHOST')}
    # Check if the Domain can be contacted
    if (!($?)) {$Error[0].Exception.InnerException;
        If ($Error[0].Exception.HResult -eq -2146233087) {
            Write-Host "Failed to query for computer account names from Active Directory.`nOnly the localhost will be enumerated for Network Sessions." -ForegroundColor Yellow
            $ComputerName = 'LOCALHOST'
            }
        }
    }
# Set initial variables
$Global:Results = @(); [int]$i = 1;
# Loop through the computer list
foreach ($comp in $ComputerName) {
    if ($ComputerName -ne 'LOCALHOST'){cls; "Enumerating Net Sessions (host $i out of $($ComputerName.Count))..."}
    $temp = & $env:TEMP\ns.exe $comp 2>&1 # Peform the NetSessionEnum
    for ($c = 3; $c -le $($temp.Count-3);$c++) { # For each Net Session on that host -
        $res = $temp[$c].ToString().split()| where {$_}
        #$res=$temp[$c].ToString().split(" ",[System.StringSplitOptions]::RemoveEmptyEntries)
        switch ($res[0].replace("\\\\",""))
        {
            '[::1]' {$hostname = 'IPv6 Loopback'}
            '127.0.0.1' {$hostname = 'IPv4 Loopback'}
            default {$hostname = [System.Net.Dns]::GetHostByAddress($res[0].replace("\\\\","")).HostName}
        }
        $Global:Results += [PSCustomObject]@{
            UserName = $res[1]
            ConnectedFromIP = $res[0].replace("\\\\","")
            ConnectedFromHostName = $hostname
            ConnctedTo = $comp
            Time = $res[2]
            IdleTime = $res[3]
            }
        Clear-Variable res, hostname
        }
    Clear-Variable temp; $i++
    }
}
# If using Cached Results, it cannot be used along with -ComputerName, since all computers have already been fetched before. you can filter the results using Where-Object
if ($UseCachedResults -and $ComputerName -ne $null) {Write-Warning "-UseCachedResults was specified with -ComputerName; Displaying all cached Computer Names from previous run:"}
# If a specific UserName was specified, filter results by this UserName
if ($UserName -ne "") {
    # Check if -OpenAsGUI was specified. Note: -OpenAsGUI requires PowerShell ISE to be installed on the current machine
    switch ($OpenAsGUI) {
    $true {$Global:Results | where UserName -eq $UserName | sort IdleTime, Time | Out-GridView -Title 'Network Sessions Enumeration'}
    $false {$Global:Results | where UserName -eq $UserName | sort IdleTime, Time | ft -AutoSize }
        }
     }
    else {
    switch ($OpenAsGUI) {
    $true {$global:Results | sort UserName, IdleTime, Time | Out-GridView -Title 'Network Sessions Enumeration'}
    $false {$global:Results | sort UserName, IdleTime, Time | ft -AutoSize}
        }
    }
write-host 'Optional: Type $Global:Results to see the full list of unfiltered data (Cached Results).' -ForegroundColor Cyan
# Clean up: Delete temp exe file, and set back the original Session's Error Action Preference before exiting.
if (Test-Path $env:TEMP\ns.exe) {del $env:TEMP\ns.exe}; $ErrorActionPreference = $CurrentEAP
}
